def commitCount(u, r):
	return re.search('\d+$', requests.get('https://api.github.com/repos/{}/{}/commits?per_page=1'.format(u, r), headers=HEADER).links['last']['url']).group()

def contributorCount(u, r):
	return re.search('\d+$', requests.get('https://api.github.com/repos/{}/{}/contributors?per_page=1'.format(u, r), headers=HEADER).links['last']['url']).group()

def isBig(nb_commit, size, nb_contributors):
  global commits_limit, size_limit, contributors_limit
  return nb_commit > 100 or nb_contributors > 7 or (size > size_limit and  nb_commit > commits_limit and nb_contributors > contributors_limit)

