def barChart(titre, x_labels, x_legend, datas):
  fig, ax = plt.subplots()
  fig.suptitle(titre, fontsize="x-large")
  y_pos = np.arange(len([0,1]))
  ax.set_xticks([0,1])
  ax.set_xlabel(x_legend)
  ax.set_ylabel('%')
  ax.set_xticklabels(x_labels)
  plt.bar(y_pos, datas, align='center', alpha=0.5)

barChart("Graphique représentant la présence de minifieur en fonction de la taille", ['Petit', 'Gros'], 'Taille de projets', [r_min_taille_s/r_taille_s_tot*100, r_min_taille_l/r_taille_l_tot*100])
plt.show()

